import React from 'react';
import MyJoke from './MyJoke';

 import productData from './productData';


function App() {
    comporator = (a, b) => (a.price > b.price)
    const jokeComponents = productData
        .filter(product => product.price > 70)
        .sort()
        .map(joke => <MyJoke id={joke.id} joke={joke.joke}/>)
    return (<div>{jokeComponents}</div>)
}
export default App
